import * as d3 from "d3";

function try01() {
    // 定义数据集
    var data = [
        { day: "星期一", percentage: 100, sleep: 30.0, lesson: 34.3, play_games: 5, learn: 15, sports: 4.0, others: 11.7 },
        { day: "星期二", percentage: 100, sleep: 29.0, lesson: 37.5, play_games: 5, learn: 13.9, sports: 4.0, others: 10.6 },
        { day: "星期三", percentage: 100, sleep: 32.0, lesson: 18.8, play_games: 10, learn: 21.5, sports: 4.8, others: 12.9 },
        { day: "星期四", percentage: 100, sleep: 32.0, lesson: 18.8, play_games: 10, learn: 21.7, sports: 5.4, others: 12.1 },
        { day: "星期五", percentage: 100, sleep: 32.0, lesson: 12.5, play_games: 12.5, learn: 17.4, sports: 11.8, others: 13.8 },
        { day: "星期六", percentage: 100, sleep: 35.0, lesson: 0, play_games: 25.0, learn: 17.1, sports: 8.2, others: 14.7 },
        { day: "星期日", percentage: 100, sleep: 32.0, lesson: 12.5, play_games: 25.0, learn: 12.4, sports: 3.6, others: 14.5 },
    ];
    for (var i = 0; i < 7; i++) {
        data[i].sleep_up = data[i].sleep;
        data[i].lesson_up = data[i].lesson;
        data[i].play_games_up = data[i].play_games;
        data[i].learn_up = data[i].learn;
        data[i].sports_up = data[i].sports;
        data[i].others_up = data[i].others;
    }
    for (var i = 0; i < 7; i++) {
        if (data[i].lesson < data[i].sleep) { data[i].sleep_up += data[i].lesson; }
        if (data[i].play_games < data[i].sleep) { data[i].sleep_up += data[i].play_games; }
        if (data[i].learn < data[i].sleep) { data[i].sleep_up += data[i].learn; }
        if (data[i].sports < data[i].sleep) { data[i].sleep_up += data[i].sports; }
        if (data[i].others < data[i].sleep) { data[i].sleep_up += data[i].others; }

        if (data[i].sleep < data[i].lesson) { data[i].lesson_up += data[i].sleep; }
        if (data[i].play_games < data[i].lesson) { data[i].lesson_up += data[i].play_games; }
        if (data[i].learn < data[i].lesson) { data[i].lesson_up += data[i].learn; }
        if (data[i].sports < data[i].lesson) { data[i].lesson_up += data[i].sports; }
        if (data[i].others < data[i].lesson) { data[i].lesson_up += data[i].others; }

        if (data[i].lesson < data[i].play_games) { data[i].play_games_up += data[i].lesson; }
        if (data[i].sleep < data[i].play_games) { data[i].play_games_up += data[i].sleep; }
        if (data[i].learn < data[i].play_games) { data[i].play_games_up += data[i].learn; }
        if (data[i].sports < data[i].play_games) { data[i].play_games_up += data[i].sports; }
        if (data[i].others < data[i].play_games) { data[i].play_games_up += data[i].others; }

        if (data[i].lesson < data[i].learn) { data[i].learn_up += data[i].lesson; }
        if (data[i].play_games < data[i].learn) { data[i].learn_up += data[i].play_games; }
        if (data[i].sleep < data[i].learn) { data[i].learn_up += data[i].sleep; }
        if (data[i].sports < data[i].learn) { data[i].learn_up += data[i].sports; }
        if (data[i].others < data[i].learn) { data[i].learn_up += data[i].others; }

        if (data[i].lesson < data[i].sports) { data[i].sports_up += data[i].lesson; }
        if (data[i].play_games < data[i].sports) { data[i].sports_up += data[i].play_games; }
        if (data[i].learn < data[i].sports) { data[i].sports_up += data[i].learn; }
        if (data[i].sleep < data[i].sports) { data[i].sports_up += data[i].sleep; }
        if (data[i].others < data[i].sports) { data[i].sports_up += data[i].others; }

        if (data[i].lesson < data[i].others) { data[i].others_up += data[i].lesson; }
        if (data[i].play_games < data[i].others) { data[i].others_up += data[i].play_games; }
        if (data[i].learn < data[i].others) { data[i].others_up += data[i].learn; }
        if (data[i].sports < data[i].others) { data[i].others_up += data[i].sports; }
        if (data[i].sleep < data[i].others) { data[i].others_up += data[i].sleep; }
    }

    // 设置SVG的宽度和高度
    var width = 700;
    var height = 400;
    var margin = { top: 20, right: 20, bottom: 40, left: 40 };
    var innerWidth = width - margin.left - margin.right;
    var innerHeight = height - margin.top - margin.bottom;

    // 创建一个div元素作为SVG容器
    var container = d3.select("body")
        .append("div")
        .attr("class", "chart-container");

    // 添加标题
    container.append("h2")
        .text("每日活动时间分布图");

    // 创建SVG
    var svg = container.append("svg")
        .attr("width", width)
        .attr("height", height);

    // 创建一个内部容器，并添加到SVG中，作为绘制图形的区域
    var g = svg.append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    // 创建一个比例尺，将星期映射到X轴上的位置
    var xScale = d3.scaleBand()
        .domain(data.map(d => d.day))
        .range([0, innerWidth])
        .padding(0.1);

    // 创建一个比例尺，将百分比映射到Y轴上的位置
    var yScale = d3.scaleLinear()
        .domain([0, d3.max(data, d => d.percentage)])
        .range([innerHeight, 0]);

    // 创建一个X轴和Y轴生成器，用于在SVG中添加这些轴
    var xAxis = d3.axisBottom(xScale);
    var yAxis = d3.axisLeft(yScale);

    // 在SVG中添加X轴
    g.append("g")
        .attr("class", "x-axis")
        .attr("transform", "translate(0," + (innerHeight) + ")")
        .call(xAxis);
    // 在SVG中添加Y轴
    g.append("g")
        .attr("class", "y-axis")
        .call(yAxis);

    // 创建区域生成器
    var area2 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.lesson_up) + 20)
        .y1(d => yScale(d.lesson_up - d.lesson) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area2)
        .attr("fill", "orange");

    // 创建区域生成器
    var area1 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.sleep_up) + 20)
        .y1(d => yScale(d.sleep_up - d.sleep) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area1)
        .attr("fill", "red");

    // 创建区域生成器
    var area3 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.play_games_up) + 20)
        .y1(d => yScale(d.play_games_up - d.play_games) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area3)
        .attr("fill", "yellow");

    // 创建区域生成器
    var area4 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.learn_up) + 20)
        .y1(d => yScale(d.learn_up - d.learn) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area4)
        .attr("fill", "green");

    // 创建区域生成器
    var area5 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.sports_up) + 20)
        .y1(d => yScale(d.sports_up - d.sports) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area5)
        .attr("fill", "blue");

    // 创建区域生成器
    var area6 = d3.area()
        .x(d => xScale(d.day) + xScale.bandwidth() / 2 + 20)
        .y0(d => yScale(d.others_up) + 20)
        .y1(d => yScale(d.others_up - d.others) + 20)
        .curve(d3.curveBumpX);
    // 在SVG中添加区域路径
    svg.append("path")
        .datum(data)
        .attr("d", area6)
        .attr("fill", "purple");

    //整点图例
    const legend = svg.append("g")
        .attr("transform", "translate(10,10)");
    const legendKeys = ["睡觉", "上课", "游戏", "学习", "运动", "其它"];
    const legendColor = ["red", "orange", "yellow", "green", "blue", "purple"];
    legend.selectAll("rect")
        .data(legendKeys)
        .enter()
        .append("rect")
        .attr("x", 640)
        .attr("y", (d, i) => i * 20)
        .attr("width", 15)
        .attr("height", 12)
        .attr("fill", (d, i) => legendColor[i]);
    legend.selectAll("text")
        .data(legendKeys)
        .enter()
        .append("text")
        .attr("x", 658)
        .attr("y", (d, i) => i * 20 + 10)
        .text(d => d);

}


function try02() {

    console.log("try02")
}

export default try01; // 指定默认输出
try01();
try02();
